import React from "react";
import { Route, Routes } from "react-router-dom";
import Layout from "./layout/Layout";
import './style.css';

function App() {
  return (
    <div>
      <Routes>
        <Route path="/">
        <Layout/>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
